const lineChartData = {
    labels,
    datasets: [
      {
        label: `Historical Prices in ${selectedDistrict}`,
        data: labels.map(year => historicalDataMap.get(year) ?? null),
        borderColor: "#1F77B4",
        backgroundColor: "rgba(31, 119, 180, 0.2)",
        borderWidth: 2,
        pointRadius: 4,
        pointBackgroundColor: "#1F77B4",
        tension: 0.3,
      },
      {
        label: `Predicted Prices in ${selectedDistrict}`,
        data: labels.map(year => predictionDataMap.get(year) ?? null),
        borderColor: "#D72638",
        backgroundColor: "rgba(215, 38, 56, 0.2)",
        borderWidth: 2,
        pointRadius: 4,
        pointBackgroundColor: "#D72638",
        borderDash: [6, 4],
        tension: 0.3,
      },
    ],
  };
